import React from 'react';
import Card from './Card';
 const Card_List = ({robots}) => {
const cardarray = robots.map((user,i) => {
    return <Card id={robots[i].id} name={robots[i].name} email={robots[i].email} />;

})
     return (

         <div>
          {cardarray}
         </div>
     );
 }
 export default Card_List;
